//כרטיסים בחבילה
//הקומפוננטה נמצאת בתוך תמחור מכירה
import React,{useState} from 'react'
const Packages = () => {
    let percentage;
    let [qty, setQty] = useState(0);
    return (
        <form>
            <div class="ui equal width form">
                <div class="fields">
                    <div class="field">
                        <label>Quantity of tickets</label>
                        <input type="number" onChange={(e) => { qty = e.target.value }} />
                    </div>
                    <div class="field">
                        <label>Discount percentages</label>
                        <input type="number" onChange={(e) => { percentage = e.target.value }} required={qty > 0} />
                    </div>
                </div>
            </div>
            <button class="positive ui button">ok</button>
        </form>
    );
}

export default Packages;
